using Microsoft.AspNetCore.SignalR;

namespace DndUtils;

public class MapHub : Hub
{
    // DM joins a group identified by roomId
    public async Task JoinRoom(string roomId, bool isDm)
    {
        await Groups.AddToGroupAsync(Context.ConnectionId, roomId);

        if (!isDm)
        {
            // Notify DM that a new player joined
            await Clients.Group(roomId).SendAsync("PlayerJoined", Context.ConnectionId);
        }
    }

    // DM sends full canvas snapshot to a specific player
    public async Task SendFullFogToPlayer(string connectionId, string base64Image)
    {
        await Clients.Client(connectionId).SendAsync("ReceiveFullFog", base64Image);
    }

    // DM sends chunk updates to everyone else in the room
    public async Task BroadcastFogUpdate(string roomId, string base64Chunk, int x, int y, int width, int height)
    {
        await Clients.Group(roomId).SendAsync("ReceiveFogUpdate", base64Chunk, x, y, width, height);
    }






    // DM sends a fog chunk (or full canvas)
    public async Task UpdateFog(string base64Chunk, int x, int y, int width, int height)
    {
        await Clients.Others.SendAsync("ReceiveFogUpdate", base64Chunk, x, y, width, height);
    }

    // Player requests full fog when joining
    public async Task RequestFullFog()
    {
        // Ask DM client to send full fog to this player
        await Clients.Others.SendAsync("SendFullFogToPlayer", Context.ConnectionId);
    }




    private string dataString = "data:image/png;base64,…";
}
